import React from 'react';
import './Header.css';

function Header() {
  return (
    <div className="App">
      <header>
        <div className="header">

          <ul className="headerList">
            <li id="header_weather">Weather</li>
            <li id="header_news">News</li>
            <li>
              <form onSubmit={this.props.getLocation}>
                <label>Search</label>
                <input type="text" placeholder="Type a city" aria-label="type a city to get weather and latest news"></input>
              </form>
            </li>
          </ul>
        </div>
      </header>
    </div>
  );
}

export default Header;
